import { Button, HStack, Center } from "@chakra-ui/react";
import Profile from "../components/Profile";

const Header = () => {
  return (
    <Center>
      <HStack>
        <Profile/>
        <Profile/>
      </HStack>
      <Button>Go!</Button>
    </Center>
  );
};

export default Header;
